import React from 'react';
import picture from "./picture.png";
import './App.css';
import {
  RoundedCircle,
} from "bootstrap"

function App() {

    return (
    <div className="App">
        <img src={picture}   roundedCircle   alt="persopicture"     style={{  margin : 100, position: 'absolute',
marginRight : 100, width: 200, height: 200, borderRadius: 100}} 
/>

    </div>
  );
}

export default App;
